const PostSingle = ({posts, children}) => {
    return posts
        ? <div>
            <h3>Username: {posts.author.username}</h3>
            <div>Title: {posts.title}</div>
            <div>Price: {posts.price}</div>
            <div>Description: {posts.description}</div>
            {
                children
            }
        </div>
        : 'Loading....'

}

export default PostSingle;
